import React from 'react';
import './Hero.css';
import profile from '../assets/profile.jpg';
import { Container, Button } from 'react-bootstrap';

function Hero() {
  return (
    <div className="hero-section" id="home">
      <Container className="text-white">
        <h1>Hi, I'm <span className="highlight">Safaq Jamal</span></h1>
        <p className="lead">A passionate frontend developer, building modern web experiences</p>
        <div className="hero-buttons">
          <Button variant="warning">View My Work</Button>
          <Button variant="outline-light">Get In Touch</Button>
        </div>
        <img src={profile} alt="Profile" className="hero-img" />
      </Container>
    </div>
  );
}

export default Hero;
